<div class="map-intro">
  <p>景元三年 (262) 時的三國地圖, 以譚其驤的<b>中國歷史圖集</b>為底圖, 並參考HydroSHEDS的3弧秒 (~100米) 分辨率高程模型，對偏差處做了調整。
    整套地圖也在 <u><a href="https://kongming.net/map/">KMA</a></u> 上發佈。</p>
<br>
  <p> <u><a href="../maps/Xiyu.png">西域圖</a></u> |  <u><a href="../maps/Overall.png">全圖(簡)</a></u> | <u><a href="../maps/Overall_detailed.png">全圖</a></u> </p>
<br>
  <P> 若需高清版地圖，或有其它定制需求，歡迎隨時聯係。</P>

<script>
  async function includeHTML(id, file, callback) {
    const res = await fetch(file);
    const html = await res.text();
    document.getElementById(id).innerHTML = html;

    if (callback) callback();
  }

  
  includeHTML("navbar", "nav_zh.html", () => {

    const script = document.createElement("script");
    script.src = "scripts/navbar_zh.js"; 
    script.defer = true;


    script.onload = () => {
      const isGithub = location.hostname.includes("github.io");
      const pathParts = window.location.pathname.split("/");
      const repoName = pathParts[1] || "";
      const basePath = isGithub ? `/${repoName}/` : "/";

      if (typeof setNavLinks === "function") {
        setNavLinks(basePath);
      } else {
        console.warn("Navbar logic (setNavLinks) did not load");
      }
    };

    document.head.appendChild(script);
  });

 
  includeHTML("footer", "../footer.html");
